There are two complementary approaches to testing functionality: Testing the small units that you build your complete application from, these are called "unit tests". There is also testing the final application "from the outside" called "black box tests" or "integration tests". Let's begin with the first one. To figure out what we should test, let's see what our program features are. Mainly, grrs is supposed to print out the lines that match a given pattern. So, let's write unit tests for exactly this : We want to ensure that our most important piece of logic works, and we want to do it in a way that is not dependent on any of the setup code we have around it (that deals with CLI arguments, for example). Going back to our first implementation of grrs, we added this block of code to the main function: // ...
for line in content.lines() { if line.contains(&args.pattern) { println!("{}", line); }
} Sadly, this is not very easy to test. First of all, it's in the main function, so we can't easily call it. This is easily fixed by moving this piece of code into a function: fn find_matches(content: &str, pattern: &str) { for line in content.lines() { if line.contains(pattern) { println!("{}", line); } }
} Now we can call this function in our test, and see what its output is: #[test]
fn find_a_match() { find_matches("lorem ipsum\ndolor sit amet", "lorem"); assert_eq!( // uhhhh Or… can we? Right now, find_matches prints directly to stdout, i.e., the terminal. We can't easily capture this in a test! This is a problem that often comes up when writing tests after the implementation: We have written a function that is firmly integrated in the context it is used in. Note: This is totally fine when writing small CLI applications. There's no need to make everything testable! It is important to think about which parts of your code you might want to write unit tests for, however. While we'll see that it's easy to change this function to be testable, this is not always the case. Alright, how can we make this testable? We'll need to capture the output somehow. Rust's standard library has some neat abstractions for dealing with I/O (input/output) and we'll make use of one called std::io::Write . This is a trait that abstracts over things we can write to, which includes strings but also stdout. If this is the first time you've heard "trait" in the context of Rust, you are in for a treat. Traits are one of the most powerful features of Rust. You can think of them like interfaces in Java, or type classes in Haskell (whatever you are more familiar with). They allow you to abstract over behavior that can be shared by different types. Code that uses traits can express ideas in very generic and flexible ways. This means it can also get difficult to read, though. Don't let that intimidate you: Even people who have used Rust for years don't always get what generic code does immediately. In that case, it helps to think of concrete uses. For example, in our case, the behavior that we abstract over is "write to it". Examples for the types that implement ("impl") it include: The terminal's standard output, files, a buffer in memory, or TCP network connections. (Scroll down in the documentation for std::io::Write to see a list of "Implementors".) With that knowledge, let's change our function to accept a third parameter. It should be of any type that implements Write. This way, we can then supply a simple string in our tests and make assertions on it. Here is how we can write this version of find_matches: fn find_matches(content: &str, pattern: &str, mut writer: impl std::io::Write) { for line in content.lines() { if line.contains(pattern) { writeln!(writer, "{}", line); } }
} The new parameter is mut writer, i.e., a mutable thing we call "writer". Its type is impl std::io::Write, which you can read as "a placeholder for any type that implements the Write trait". Also note how we replaced the println!(…) we used earlier with writeln!(writer, …). println! works the same as writeln! but always uses standard output. Now we can test for the output: #[test]
fn find_a_match() { let mut result = Vec::new(); find_matches("lorem ipsum\ndolor sit amet", "lorem", &mut result); assert_eq!(result, b"lorem ipsum\n");
} To now use this in our application code, we have to change the call to find_matches in main by adding &mut std::io::stdout() as the third parameter. Here's an example of a main function that builds on what we've seen in the previous chapters and uses our extracted find_matches function: fn main() -> Result<()> { let args = Cli::parse(); let content = std::fs::read_to_string(&args.path) .with_context(|| format!("could not read file `{}`", args.path.display()))?; find_matches(&content, &args.pattern, &mut std::io::stdout()); Ok(())
} Note: Since stdout expects bytes (not strings), we use std::io::Write instead of std::fmt::Write. As a result, we give an empty vector as "writer" in our tests (its type will be inferred to Vec<u8>), in the assert_eq! we use a b"foo". (The b prefix makes this a byte string literal so its type is going to be &[u8] instead of &str). Note: We could also make this function return a String, but that would change its behavior. Instead of writing to the terminal directly, it would then collect everything into a string, and dump all the results in one go at the end. Exercise for the reader: writeln! returns an io::Result because writing can fail, for example when the buffer is full and cannot be expanded. Add error handling to find_matches. We've just seen how to make this piece of code easily testable. We have identified one of the core pieces of our application, put it into its own function, and made it more flexible. Even though the goal was to make it testable, the result we ended up with is actually a very idiomatic and reusable piece of Rust code. That's awesome!

