#[derive(Parser)]
struct Cli { /// The pattern to look for pattern: String, /// The path to the file to read path: std::path::PathBuf,
} 注意: 你可以将许多自定义的属性添加到字段中， 举例来说, 如果您想将此字段用于 -o 或 --output 之后的参数， 你可以增加 #[arg(short = 'o', long = "output")]， 想要了解更多信息， 请移步 clap 的文档 . 在 Cli struct 的正下方，我们的模板包含它的 main 函数。 当程序启动时，它会调用这个函数， 其第一行是： fn main() { let args = Cli::parse();
